O finlandês (suomi, suomen kieli) é um idioma da família das línguas urálicas, à qual também pertence o húngaro, mais especificamente do ramo fino-permiano, ao qual também pertencem o estoniano, o lapônio (sámi) e o carélio. O finlandês tem a característica de não pertencer ao tronco indo-europeu, de forma oposta à maior parte das línguas europeias. Pertencente ao tronco urálico e ao ramo fino-permiano, assim como o estoniano e o livónio, tem morfologia do tipo aglutinante, e o acento tônico recai sempre sobre a primeira sílaba da palavra. O sistema de declinação conta com um complexo conjunto de quinze casos, a saber: 
* caso nominativo, caso do sujeito; 
* caso genitivo, caso do adjunto adnominal de posse; 
* caso acusativo, caso do objeto direto; 
* caso essivo, caso do adjunto adnominal de estado; 
* caso partitivo, caso do adjunto adnominal de parte; 
* caso translativo, caso do adjunto adverbial de mudança de estado; 
* caso inessivo, caso do adjunto adverbial de lugar; 
* caso elativo, caso do adjunto adverbial de saída de um lugar; 
* caso ilativo, caso do adjunto adverbial de entrada de um lugar; 
* caso adessivo, caso do adjunto adverbial de lugar externo; 
* caso ablativo, caso do adjunto adverbial de saída de lugar externo; 
* caso alativo, caso do adjunto adverbial de entrada em um lugar externo; 
* caso abessivo, caso do adjunto adnominal/adverbial de ausência; 
* caso comitativo, caso do adjunto adverbial de companhia; 
* caso instrutivo, caso do adjunto adverbial de instrumento. O número – singular ou plural – é determinado pelas diferentes terminações em cada declinação. Não existem gêneros, nem artigos. Como em finlandês a função sintática é determinada pelas declinações (que se distinguem pela terminação de cada palavra, como em latim), a ordem das palavras indica a forma definida ou indefinida. Por exemplo, para se dizer "a flor está sobre a mesa", diz-se, em finlandês: kukka on pöydällä, ao passo que pöydällä on kukka se traduz por "há uma flor sobre a mesa".
